import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: '/people.jpeg',
    altText: 'people',
    caption: 'People',
    header: 'People',
    key: '1',
  },
  {
    src: '/purpose.jpg',
    altText: 'Purpose',
    caption: 'Purpose',
    header: 'Purpose',
    key: '2'
  },
  {
    src: '/passion.jpg',
    altText: 'Passion',
    caption: 'Passion',
    header: 'Passion',
    key: '3'
  }
];


const MyEthos = () => <UncontrolledCarousel items={items} />;

export default MyEthos;
